import Layout from '../components/PageLayout';
import { CardGroup, Card, Image, Button, Carousel, Container, Row, Col } from 'react-bootstrap';
import ScrollAnimation from 'react-animate-on-scroll';
import React from 'react'
import ReactPlayer from 'react-player'


const Index = () => (
  <Layout>
    <title>The History of BfBB</title>

    <div style={{width:'100%',paddingLeft:'10%',paddingRight:'10%',height:'20vw'}}>
        <iframe width="100%" height="100%" src="https://www.youtube.com/embed/videoseries?list=PLDzuZShnnVbZ78eM3wnnXq1C3mnU2PMZf" frameborder="0" allow="autoplay; encrypted-media" allowfullscreen></iframe>
    </div>

    <style>
      {`
        .column {
          float: left;
          height: 100%;
        }

        body {
          background-color: #6F419C;
          background-image: url('shift-bg.png');
        }

        /* width */
        ::-webkit-scrollbar {
          width: 10px;
        }

        /* Track */
        ::-webkit-scrollbar-track {
          background: #f1f1f1;
        }

        /* Handle */
        ::-webkit-scrollbar-thumb {
          background: #888;
        }

        /* Handle on hover */
        ::-webkit-scrollbar-thumb:hover {
          background: #555;
        }
      `}
    </style>

  </Layout>
);

export default Index;
